import React from 'react'

const Display = ({data}) => {

console.log(data)

const {loader, resp, err} = data

  return (
    <div className='row'>
        <div className='col-12'>
            {
                        loader ? (<div>Loading....</div>) : 

                        resp.length > 0 ? (
                        <div>{
                                console.log(resp.meaning)
                            }</div>





                        ) : 



                        err ? (<div>{err}</div>) : null
            }
        </div>
    </div>
  )
}

export default Display
